import React from 'react';
import { Card, Col, Row } from 'antd';
import "./styling/app.css"
import { Link } from "react-router-dom";
import Quiz from './Optionso/quiz';

class First extends React.Component{
  render(){
  return(
  <div className="container" style={{ background: '#ECECEC', padding: '20px', alignContent: 'center', opacity: .4}}>
    <Row gutter={16} >
      <Col className='img1' span={8}>
        <Card  bordered={false}><Quiz/></Card>
      </Col>

      <Col className='img3' span={8}>
        <Card title="Take Away The Excuse" bordered={false}>Card content</Card>
      </Col>
    </Row>

    <Row>
      <h1>Are You Willing To Cont.</h1>
    <Link to="/third">Second</Link>
    </Row>
  </div>

  );
}
}

export default First;
